import { Fragment } from 'react';
import { Link, Outlet } from 'react-router-dom';


const Navigationbar = () => {
    return (
        <Fragment>
            <div className='Navigation'>
                <div>logo</div>
                <div className='links-container'></div>
                 <Link className='nav-link' to='/shop'>
                 </Link>
            </div>
            <Outlet />
        </Fragment>
    );

};

export default Navigationbar;
